function isValidBase64DataURL(dataURL) {
    //check data:image/jpeg;base64 is include in staring
    const dataURLRegex = /^data:([a-zA-Z0-9-+/.]+);base64,(.*)$/;
    const match = dataURL.match(dataURLRegex);
    if (!match) {
        return false;
    }
    const base64Part = match[2];
    return isValidBase64(base64Part);
}
function isValidBase64(base64String) {
    const base64Regex = /^(?:[A-Z0-9+\/]{4})*(?:[A-Z0-9+\/]{2}==|[A-Z0-9+\/]{3}=)?$/i;
    if (!base64Regex.test(base64String)) {
        return false;
    }
    try {
        atob(base64String);
        return true;
    } catch (e) {
        return false;
    }
}
